import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, Container, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Quote() {
    const [quote, setQuote] = useState('');

    async function fetchRandomQuote() {
        try {
            const response = await fetch("https://api.quotable.io/random");
            if (!response.ok) {
                throw new Error("Failed to fetch a quote");
            }
            const data = await response.json();
            return data.content;
        } catch (error) {
            console.error(error);
            return "An error occurred while fetching the quote.";
        }
    }

    async function generateRandomQuote() {
        const randomQuote = await fetchRandomQuote();
        setQuote(randomQuote);
    }

    useEffect(() => {
        generateRandomQuote();
    }, []);

    return (
        <div style={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Link to="/" className="navbar-brand">Quotez</Link>
                    <Navbar.Toggle aria-controls="navbarNav" />
                    <Navbar.Collapse id="navbarNav">
                        <Nav className="ms-auto">
                            <Link to="/" className="nav-link">Home</Link>
                            <Link to="/about" className="nav-link">About</Link>
                            <Link to="/contact" className="nav-link">Contact</Link>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>

            <br />
            <br />
            <br />
            <br />
            <Container className="flex-grow-1 mt-5">
                <div className="text-center">
                    <h1>Random Quote Generator</h1>
                    <em id="quote">{quote}</em>
                    <br />
                    <br />
                    <Button id="generateButton" variant="primary" onClick={generateRandomQuote}>Generate Quote</Button>
                </div>
            </Container>

            <footer className="bg-dark text-light pt-4">
                <Container>
                    <div className="row">
                        <div className="row py-3">
                            <h3 className="text-center"><em>Quotez</em></h3>
                        </div>
                        <div className="col-md-6">
                            <p>Phone : +62 851-5503-5225</p>
                            <p>Address : Del Institute of Technology</p>
                        </div>
                        <div className="col-md-6 text-center">
                            <p>Follow me on:</p>
                            <Link to="https://www.facebook.com/kevin.samosir.505" target="_blank" className="mx-2"><i
                                className="fab fa-facebook-f fs-5"></i></Link>
                            <Link to="https://www.instagram.com/kevinsmr__/" target="_blank" className="mx-2"><i
                                className="fab fa-instagram fs-5"></i></Link>
                            <Link to="https://www.linkedin.com/in/kevin-samosir-926a45207/" target="_blank" className="mx-2">
                                <svg xmlns="http://www.w3.org/2000/svg" height="1.5em" viewBox="0 0 320 512" style={{ fill: "#044cff" }}>
                                    <path d="M279.14 288l14.22-92.66h-88.91v-60.13c0-25.35 12.42-50.06 52.24-50.06h40.42V6.26S260.43 0 225.36 0c-73.22 0-121.08 44.38-121.08 124.72v70.62H22.89V288h81.39v224h100.17V288z" />
                                </svg>
                            </Link>
                        </div>
                    </div>
                    <p className="text-center mt-3">&copy; 2023 KipinQuotes</p>
                </Container>
            </footer>
        </div>
    );
}

export default Quote;
